def fermat(n):
    a = int(sqrt(n)) + 1
    while True:
        b1 = a * a - n
        b = int(sqrt(b1))
        if b * b == b1:
            break
        else:
            a += 1
    return [a - b, a + b]

p, q = fermat(n)

phi = (p - 1) * (q - 1)
d = pow(e, -1, phi)

m = pow(c, d, n)

